create table employee (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	gender VARCHAR(50),
	salary INT,
	dept_id INT
);

select * from Employee;
select  * from (select top 2 * from Employee where dept_id in (select distinct dept_id from employee) order by salary desc) t1 group by dept_id;

